import React, { useState } from 'react'
import { useSelector,useDispatch } from 'react-redux';
import {PARK} from "./redux/actionType"

function ParkingLot({setNumber,number}) {

    const state=useSelector((state)=>state);
    const dispatch=useDispatch();

        const[vehicledetails,setVehicledetails]=useState({
            vehiclenumber:"",vehicledate:"",vehicletime:""
        });

        function handlevehiclenumber(e){
            setVehicledetails({...vehicledetails,vehiclenumber:e.target.value})
        }
        function handledate(e){
            setVehicledetails({...vehicledetails,vehicledate:e.target.value})
        }
        function handletime(e){
            setVehicledetails({...vehicledetails,vehicletime:e.target.value})
        }

        function handledetails(){
            dispatch( PARK(vehicledetails) )
        }

  return (
    <div style={{borderRadius:"5px",border:"1px solid black",display:"flex",justifyContent:"center",alignContent:"center",flexWrap:"wrap"}}> 
      {
        [...Array(parseInt(number))].map((element,index)=>(
         
                <div style={{width:"9%",height:"50px",borderRadius:"5px",border:"1px solid black",margin:"0.1rem",display:"flex",justifyContent:"center",alignItems:"center"}} key={index+index}>
                    <h3>P{index+1}</h3>    
                </div>

        ))

            // vehicle number , date , time , submit button 
      }
      <div>
        <input type="text"  onChange={handlevehiclenumber}/>
        <input type="date" onChange={handledate}/>
        <input type="time" onChange={handletime}/>
        <button onClick={handledetails}>Submit details</button>
      </div>
    </div>
  )
}

export default ParkingLot
